window.bookSummaryJSON = "<p>After a black witch pitched a hissy fit in Hollis Apothecary, Rue got stuck cleaning up his mess. That was the easy part. Repairing the damage he inflicted on Camber and Arden? That makes Rue wish she could bring him back to life just to kill him again. Slower this time.</p> <p>While Rue is setting her new life back to rights, Clay and Asa are off working a case, but it soon becomes clear that they'll need her help to catch the vicious creature preying on locals in a small Tennessee town. She's got her hands full at home, but Rue has no choice. She must report for duty to honor her agreement with the director. Or else.</p> <p>What she discovers leads her deeper down the rabbit hole of Black Hat Bureau corruption and promises that, no matter how grim the past few weeks have been, the worst is yet to come.</p> <p>Contains mature themes.</p>"; 
